【200系ハイエース1型/2型/3型専用フットランプ（左右1セット）】<br>
ドア開閉と連動点灯！<br>
足元を明るく照らす、純正パネル交換タイプ<br><br>
本製品は、純正のパーツを加工したオリジナル製品なので、フィット感抜群！<br>
さらに、超明るいCOB LEDを採用。通常のLEDとは明るさが違います！<br><br>
■足元の安全を確保！<br>
夜間の乗り降り時に運転席・助手席の足元を照らす照明が<br>
ありませんでしたが、本製品を付けることで足元が明るくなり<br>
（ドア開閉と連動点灯）安全に乗り降りができます。<br>
<br>
【セット内容】<br>
本体×2、配線、エレクトロタップ×2、取付説明書<br>







