D.A.D スマートフォンホルダー タイプ エグゼクティブ <br><br>
在庫展示用でパッケージに汚れがあるため、大特価！在庫限りなのでお早めに！
<br><br>

iPhone・エクスペリアなどのスマートフォンや折りたたみ式携帯電話の画面を隠さずにホールド！<br>
■ボディカラー：ブラック<br>
■エンブレムカラー：ゴールド<br>
■スワロフスキー・エレメント：クリスタル<br><br>

【軟質グリップ採用】<br>
エラストマーを採用した軟質グリップにより、スマートフォンを優しく、しっかりホールドします。<br><br>
 【あらゆるスマートフォン・携帯電話に対応】<br>
ホルダー本体が左右に伸ばすことができ、46mm～68mmまでの各社スマートフォン＆折りたたみ式携帯電話に対応します。また、裏面のボタンを押すだけで簡単にホルダー本体から脱着することができます。<br><br>
 【90°回転可能】<br>
スマートフォンをホールドしたままで左右90°に回転することが可能。お好みに合わせて縦画面/横画面に切り替えができます。<br><br>
 【アングルプレート付属】<br>
アングルプレート付属により傾斜のついた面にも取付可能。<br>







