 きらびやかで贅沢な輝きを放つクリスタルビーズを一粒一粒丁寧に手作りで仕上げた、キュートでラグジュアリー感漂うクリスタルベアがキーリングになって新登場です。<br>
 王冠を被った「キング」と、ティアラを身に着けた「クイーン」の2種類からなり、大切な人へのプレゼントに最適です。<br>
 王冠・ティアラ共に、眩い輝きを放つスワロフスキー・エレメントを贅沢に施しています。<br>







